import "./BottomBar.css";

const BottomBar = () => {
    return (
        <div className="BOTTOM_BAR">
            <div className="BOTTOM_BAR_ICON FISRT_ICON">1</div>
            <div className="BOTTOM_BAR_ICON SECOND_ICON">2</div>
            <div className="BOTTOM_BAR_ICON THIRD_ICON">3</div>
        </div>
    );
};

export default BottomBar;
